Release Info:

The wheels keep spinning in one of the most acclaimed racing simulation

games available. Forza 4 increases the immersion with compatibility with

the Kinect motion control camera.



Through the power of Kinect, players will be able to step through the TV

screen and jump into the driver\'s seat while the engaging controller-based

experience will let you take on the bone-jarring physics, unparalleled

levels of customization, and rosters of dream cars and tracks. Offering

gameplay that will electrify racing fans and excite car lovers and novices

alike, the popular racing franchise returns.





